import React from "react";
import { Form } from "react-bootstrap";

const SignUp = () => {
    return (
        <div className="container">
            <div className="form">
                <h1>Sign Up</h1>
                <form>
                    <Form.Group>
                        <Form.Label>Username</Form.Label>
                        <Form.Control type="text" placeholder="Enter username" />
                    </Form.Group>
                </form>
            </div>
        </div>
    );
}

export default SignUp;
